      <h2>Sneaker Company</h2>
      <ProductInfo
        name="Fall Limited Edition Sneakers"
        desc="These low-profile sneakers are your perfect casual wear companion. Featuring a durable rubber outer sole, theyâ€™ll withstand everything the weather can offer."
        currPrice="$125.00"
        discount="50%"
        orgiPrice="$250.00"
      />
    </div>
  );
}

const ProductInfo = ({ name, desc, currPrice, discount, orgiPrice }) => {
  return (
    <div>
      <p className="name">{name}</p>
      <p className="description">{desc}</p>
      <p className="currPrice">{currPrice}</p>
      <p className="discount">{discount}</p>
      <p className="orgiPrice">{orgiPrice}</p>
    </div>
  );
};

export default Product;
